css:
.scrollbars-visible-always .editor ::-webkit-scrollbar-track,
.scrollbars-visible-always .editor ::-webkit-scrollbar-corner {
  background: transparent;
}
.scrollbars-visible-always .editor ::-webkit-scrollbar-thumb {
  background: #f1c40f;
}
.editor-colors {
  background-color: #2c3e50;
  color: #ecf0f1;
}
.editor {
  background-color: #2c3e50;
  color: #ecf0f1;
}
.editor .wrap-guide {
  background-color: #34495e;
}
.editor .indent-guide {
  color: #34495e;
}
.editor .invisible-character {
  color: #34495e;
  font-weight: bold !important;
}
.editor .gutter {
  background-color: #e74c3c;
  color: #ecf0f1;
}
.editor .gutter .line-number.cursor-line {
  background-color: #c0392b;
  color: #ecf0f1;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #ecf0f1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #c0392b;
  font-weight: bold;
}
.editor .gutter .line-number.folded.cursor-line-no-selection,
.editor .gutter .line-number:after.cursor-line-no-selection,
.editor .fold-marker:after.cursor-line-no-selection {
  color: #ecf0f1;
  font-weight: normal;
}
.editor .invisible {
  color: #ecf0f1;
}
.editor .cursor {
  color: #ecf0f1;
}
.editor .selection .region {
  background-color: #34495e;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #34495e;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #34495e;
}
.comment {
  color: #7f8c8d;
}
.entity.name.type {
  color: #ecf0f1;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #27ae60;
}
.keyword {
  color: #f1c40f;
}
.keyword.control {
  color: #f1c40f;
}
.keyword.operator {
  color: #ecf0f1;
}
.keyword.other.special-method {
  color: #2ecc71;
}
.keyword.other.unit {
  color: #3498db;
}
.storage {
  color: #f1c40f;
}
.constant {
  color: #3498db;
}
.constant.character.escape {
  color: #1abc9c;
}
.constant.numeric {
  color: #3498db;
}
.constant.other.color {
  color: #1abc9c;
}
.constant.other.symbol {
  color: #27ae60;
}
.variable {
  color: #1abc9c;
}
.variable.interpolation {
  color: #148f77;
}
.variable.parameter.function {
  color: #ecf0f1;
}
.invalid.illegal {
  background-color: #1abc9c;
  color: #2c3e50;
}
.string {
  color: #27ae60;
}
.string.regexp {
  color: #1abc9c;
}
.string.regexp .source.ruby.embedded {
  color: #3498db;
}
.string.other.link {
  color: #1abc9c;
}
.punctuation.definition.comment {
  color: #7f8c8d;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #ecf0f1;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #2ecc71;
}
.punctuation.definition.bold {
  color: #ecf0f1;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #f1c40f;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #148f77;
}
.support.class {
  color: #ecf0f1;
}
.support.function {
  color: #1abc9c;
}
.support.function.any-method {
  color: #2ecc71;
}
.entity.name.function {
  color: #2ecc71;
}
.entity.name.class,
.entity.name.type.class {
  color: #ecf0f1;
}
.entity.name.section {
  color: #2ecc71;
}
.entity.name.tag {
  color: #1abc9c;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #3498db;
}
.entity.other.attribute-name.id {
  color: #2ecc71;
}
.meta.class {
  color: #ecf0f1;
}
.meta.link {
  color: #3498db;
}
.meta.require {
  color: #2ecc71;
}
.meta.selector {
  color: #f1c40f;
}
.meta.separator {
  background-color: #7f8c8d;
  color: #ecf0f1;
}
.none {
  color: #ecf0f1;
}
.markup.bold {
  color: #3498db;
  font-style: bold;
}
.markup.changed {
  color: #f1c40f;
}
.markup.deleted {
  color: #1abc9c;
}
.markup.italic {
  color: #f1c40f;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #2ecc71;
}
.markup.inserted {
  color: #27ae60;
}
.markup.list {
  color: #1abc9c;
}
.markup.quote {
  color: #3498db;
}
.markup.raw.inline {
  color: #27ae60;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #27ae60;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
.preprocessor {
  color: #27ae60;
}
